alph1 = list(map(chr, list(range(ord('c'), ord('z')+1))))
alph2 = list(map(chr, list(range(ord('e'), ord('z')+1))))
key = dict(zip(alph1, alph2)) 
key['a'] = 'c'
key['b'] = 'd'
